import React, { Component } from 'react';
//import { Jumbotron } from 'react-bootstrap';
import homePagePhoto from '../images/homepage-test-1.jpg';
import { Jumbotron } from 'react-bootstrap';

class HomePage extends Component {
    state = {}
    render() {
        return (
            <Jumbotron fluid style={{ padding: '0 !important', margin: '0 !important' }}>
                <img
                    width="75%"
                    src={homePagePhoto}
                    alt="Savings Bonds"
                />
            </Jumbotron>
        )
    }
}

export default HomePage;
